import React from 'react';
//import logo from './logo.svg';
import './App.css';
import SignIn from './components/signin';
import  Register from './components/register'
import { BrowserRouter as Router,Link } from 'react-router-dom'
function App() {
  return (
    <div className="App">
      <Register />
      <Router>
        <Link>
          <SignIn />
        </Link>
      </Router>
    </div>
  );
}

export default App;
